import './HeroImgStyles.css';

import React from 'react'
 
import IntroImg from '../assets/Crystal-Shower.jpg'


const HeroImg = () => {
  return (
    <div className='hero'>
        <div className='mask'>
            <img className='into-img' src={IntroImg} alt='IntroImg '/>
        </div>
        <div className='content'>
            <p> </p>
        </div>
    </div>
  )
}

export default HeroImg
